import React from 'react';
import "./style.scss";

export default function Footer(){
    return <section className="footer" data-scroll-section>
        <h1>Made from</h1> 
        <h1>Scratch</h1>
        <h6>with love</h6>
        <h6>(Also using HTML,CSS,JavaScript,React,GSAP,Locomotive Scroll)</h6>
    </section>
}
